  "content": {
    "application/json": {
      "schema": {
        "type": "object",
        "description": "Represents a request to create a `Timecard`.",
        "x-release-status": "PUBLIC",
        "required": [
          "timecard"
        ],
        "properties": {
          "idempotency_key": {
            "type": "string",
            "description": "A unique string value to ensure the idempotency of the operation.",
            "maxLength": 128
          },
          "timecard": {
            "type": "object",
            "description": "A record of the hourly rate, start time, and end time of a single timecard (shift)\nfor a team member. This might include a record of the start and end times of breaks\ntaken during the shift.",
            "x-release-status": "PUBLIC",
            "required": [
              "location_id",
              "start_at",
              "team_member_id"
            ],
            "properties": {
              "id": {
                "type": "string",
                "description": "**Read only** The Square-issued UUID for this object.",
                "maxLength": 255
              },
              "location_id": {
                "type": "string",
                "description": "The ID of the [location](entity:Location) for this timecard. The location should be based on\nwhere the team member clocked in.",
                "minLength": 1
              },
              "timezone": {
                "type": "string",
                "description": "**Read only** The time zone calculated from the location based on the `location_id`,\nprovided as a convenience value. Format: the IANA time zone database identifier for the\nlocation time zone.",
                "nullable": true
              },
              "start_at": {
                "type": "string",
                "description": "The start time of the timecard, in RFC 3339 format and shifted to the location\ntimezone + offset. Precision up to the minute is respected; seconds are truncated.",
                "minLength": 1
              },
              "end_at": {
                "type": "string",
                "description": "The end time of the timecard, in RFC 3339 format and shifted to the location\ntimezone + offset. Precision up to the minute is respected; seconds are truncated.",
                "nullable": true
              },
              "wage": {
                "type": "object",
                "description": "The hourly wage rate used to compensate a team member for a [timecard](entity:Timecard).",
                "x-release-status": "PUBLIC",
